import React from "react";

import { BackgroundImgStyle } from "../../2_styles/1_layout/BackgroundImgStyle";

export default function BackgroundImg({
  bgImg,
  bgImgBlur,
  top,
  height,
  zIndexImg,
  zIndexImgShadow
}) {
  return (
    <div>
      <BackgroundImgStyle
        bgImg={bgImg}
        bgImgBlur={bgImgBlur}
        top={top}
        height={height}
        zIndexImg={zIndexImg}
        zIndexImgShadow={zIndexImgShadow}
      >
        <div className="bgImg_shadow"></div>
        <div className="bgImg"></div>
        <div className="bgImg_blur"></div>
      </BackgroundImgStyle>
    </div>
  );
}
